import './App.css';


function App() {
const card = [
  {
    name:"Ahmed",
  age:37,
  adrress:"Egypt"
},
  {
    name:"Samir",
  age:25,
  adrress:"saudia"
},
  {
    name:"magid",
  age:51,
  adrress:"Egypt"
}
]

  return (
<>
    <div className='card'>
      <h3>your name is {card.name}</h3>
      <h3>your age is {card.age}</h3>
      <h3>your country is {card.country}</h3>
    </div>
    </>
  )
}

export default App;
